import React from "react";

class questionItem extends React.Component {
  render() {
    let { answers,question ,key} = this.props;
    let elms = answers.map((index, question) => {
      return (
        <div>
          <inpupt>{index}.{question}</inpupt>
        </div>
      );
    });
    return <div className="w-full h-full">
      <p>{key+1}.{question}</p>
      {elms}</div>;
  }
}
export default questionItem;
